"Критик терминальный (интуитивный) (Противоречащий - от англ. contradictor) Аскетичен, ворчлив, любит подчеркнуть недостатки, ищет оппонента. Критикует иногда с дозой желчности. Часто имеет астеничную фигуру, испытывает сложности в общении. Хорошо может спровоцировать ситуацию, в том числе и коммерческую. Обладает большой эрудицией и памятью, часто увязает в деталях. Это - ученые-теоретики, делающие фундаментальные разработки, хорошо чувствующие также и общественно- экономические тенденции. Пользуясь аналогиями, часто могут предсказать, в какую сторону будет разворачиваться идущий процесс. Внешне бывает неряшлив и небрежен, мало следит за своим здоровьем."
Подробнее: http://bookap.info/socionica/gulenco/gl10.shtm

***

Река, берущая начало в океане, в океан же, в конечном счете, и впадет.

***

"Я"
- это не что-то, изначально присутствующее в мире;
это иллюзия, происходящая от привычки ощущать своё тело и воображать свою личность, поддерживаемая непрерывной работой мириадов нервных цепей;
это продукт активного различения отраженной в психике реальности, закодированной в частотно-импульсной последовательности нейронной активности;
это выделение из этой реальности наиболее стабильных элементов в отчаянной попытке ухватиться за ничтожные соломинки в бушующем океане непрерывной трансформации;
"Я" - иллюзия вечности, неизменности в вечно изменяющемся мире - иллюзия, из которой берёт своё начало чувство контроля, избавляющее нас от страха непредсказуемости.
